  false,\n\t\"url\": null,\n\t\"notes\": \"This tile cache service shows the locations
  of both in service and out of service submarine telecommunication cables from the
  North American Submarine Cable Association (NASCA) in coastal and offshore waters
  within the Exclusive Economic Zone (EEZ). Submarine cable data were originally received
  from NASCA as Route Position Lists (RPLs), and geospatial products were later received
  from Pacific Marine Systems, which had contracted with NASCA to produce datasets
  using the same RPLs. The geospatial data from Pacific Marine Systems were compared
  against the RPLs and subsequently used in tile cache creation. Submarine cable locations
  were screened out within 100 meters of landfall, in addition to cable segments that
  extend beyond the EEZ and do not reenter U.S. maritime waters. Cables which exit
  and reenter U.S. waters remained intact. Cables are visible from a scale range of
  1:18,489,298 to 1:36,112. Each cable contains annotation which references cable
  name, segment (if applicable), and ownership. Annotation is available at scales
  from 1:577,791 to 1:72,224. Visual representation of cables and annotation used
  published NASCA charts on NASCA's website (http://www.n-a-s-c-a.org/cable-maps)
  as a guide.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
